INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1000','Salário, vencimento, soldo ou subsídio.','Corresponde ao salário básico contratual do empregado contratado de acordo com a CLT e a  emuneração mensal do servidor público, civil ou militar. Deve ser classificado nesse código também, o afastamento por acidente de trabalho por período de até 15 dias.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1002','Descanso semanal remunerado - DSR','Valor correspondente a um dia de trabalho do empregado, incidente sobre as verbas de natureza variável, tais como: horas extras, adicional noturno, produção, comissão, etc.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1003','Horas extraordinárias','Valor correspondente a hora de trabalho do empregado, acrescido de percentual de no mínimo, 50%.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1004','Horas extraordinárias – Indenização de banco de horas','Valor correspondente a pagamento das horas extraordinárias, inicialmente destinadas para o banco de horas e que não foram compensadas.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1005','Direito de arena','Valores pagos ao atleta a título direito de arena decorrente do espetáculo.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1007','Luvas e premiações','Valores pagos ao atleta a título de prêmios e luvas.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1009','Salário-família  – complemento','Valor pago ao trabalhador, excedente ao valor do salário-família fixado pela previdência social.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1010','Salário in natura - pagos em bens ou serviços','Salário in natura, também conhecido por salário utilidade, que correspondente ao valor pago ao trabalhador em bens ou serviços, a qualquer título como moradia, alimentação, vestuário, transporte, etc.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1011','Sobreaviso','Valor correspondente a um percentual da hora normal de trabalho do empregado, estipulado em acordo ou convenção coletiva.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1014','Bolsa de estudo - estagiário','Valor pago ao trabalhador estudante em atividades práticas de complementação do currículo escolar  Lei nº 11.788 de 25/09/2008.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1099','Outras verbas salariais','Outras verbas salariais (proventos) não previstas nos itens anteriores.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1201','Adicional de função /cargo confiança','Adicional ou gratificação concedida em virtude de cargo ou função de confiança - mínimo de 40% do salário-base.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1202','Adicional de insalubridade','Adicional por serviços em condições de insalubridade.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1203','Adicional de periculosidade','Adicional por serviços em condições perigosas.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1204','Adicional de transferência','Adicional pago em razão de transferência de empregado, pago regularmente.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1205','Adicional noturno','Valor correspondente a, no mínimo, 20% do valor da hora normal, trabalho realizado em horário noturno (de 22:00 hs. a 05:00 hs. na atividade urbana e de 20:00 hs. a 04:00 hs. na atividade rural) – conforme art. 7º, inciso IX.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1206','Adicional por tempo de serviço','Verba paga ao trabalhador em virtude do tempo de serviço para o mesmo empregador – convenção coletiva / estatuto da empresa.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1207','Comissões, porcentagens, produção','Valor pago ao trabalhador pela contraprestação de serviço, normalmente baseada em um percentual sobre as vendas totais desse trabalhador.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1208','Gueltas','Gratificações pagas por fornecedores diretamente ao empregado, ou repassadas pelo empregador.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1209','Gorjetas','Gorjetas pagas por clientes diretamente ao empregado, ou repassadas pelo empregador.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1210','Gratificação por acordo ou convenção coletiva','Verba estabelecida em contrato ou convenção coletiva de trabalho.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1211','Gratificações','Gratificações pagas por liberalidade do empregador ou ajustadas, expressas ou tácitas não pactuadas em acordos ou convenções coletivas, tais como produtividade, etc.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1212','Participação em lucros ou resultados da empresa – PLR','Valores pagos a trabalhadores a título de participação em lucros ou resultados da empresa, quando pagas ou creditadas ao empregado de acordo com lei específica.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1213','Quebra de caixa','Valor pago para cobrir os riscos assumidos pelo empregado que trabalha com manuseio de valores, para compensar eventuais descontos ou diferenças de numerários.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1299','Outros Adicionais e Auxílios','Valores pagos a trabalhadores relativos a outros adicionais e auxílios não previstos nos itens anteriores.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1401','Abono','Qualquer abono concedido de forma espontânea ou em virtude de convenção coletiva, norma, etc.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1402','Abono PIS / PASEP','Abono PIS / PASEP repassado pela empresa',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1403','Abono legal','As importâncias recebidas a título de ganhos eventuais e os abonos expressamente desvinculados do salário, por força da lei.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1404','Auxílio babá','O reembolso babá, limitado ao menor salário de contribuição mensal e condicionado à comprovação do registro na carteira de trabalho e previdência social da empregada, do pagamento da remuneração e do recolhimento da contribuição previdenciária, pago em conformidade com a legislação trabalhista, observado o limite máximo de 6 (seis) anos de idade da criança;',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1405','Assistência médica','O valor relativo à assistência prestada por serviço médico ou odontológico, próprio da empresa ou por ela  conveniado, inclusive o reembolso de despesas com medicamentos, óculos, aparelhos ortopédicos, despesas médico hospitalares e outras similares, desde que a cobertura abranja a totalidade dos empregados e dirigentes da empresa;',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1406','Auxílio-creche','O reembolso creche pago em conformidade com a legislação trabalhista, observado o limite máximo de 6 (seis) anos de idade da criança, quando devidamente comprovadas as despesas realizadas.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1407','Auxílio-educação','Valor relativo ao plano educacional, ou bolsa de estudo, que vise à educação básica de empregados e seus dependentes e, desde que vinculada às atividades desenvolvidas pela empresa, à educação profissional e tecnológica de empregados, nos termos da Lei nº 9.394, de 20 de dezembro de 1996, e: 1) não seja utilizado em substituição de parcela salarial; 2) o valor mensal do plano educacional ou bolsa de estuado, considerado individualmente, não ultrapasse 5% (cinco por cento) da remuneração do segurado a que se destina ou o valor correspondente a uma vez e meia o valor do limite mínimo mensal do salário de contribuição, o que for maior;',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1408','Previdência complementar','O valor relativo a programa de previdência complementar, aberto ou fechado, desde que disponível à totalidade de seus empregados e dirigentes, observados, no que couber, os arts. 9º e 468 da CLT.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1409','Salário-família','Valor do salário-família, pago no valor limite legal, em virtude do número de filhos menores de 14 anos, ou inválidos de qualquer idade.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1410','Seguros','Valor relativo a seguro de vida em grupo, desde que previsto em acordo ou convenção coletiva de trabalho e disponível à totalidade de seus empregados e dirigentes, observados, no que couber, os arts. 9º e 468 da CLT.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1601','Ajuda de custo - aeronauta','E o adicional mensal recebidos pelo aeronauta nos termos da lei nº 5.929, de 30 de outubro de 1973.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1602','Ajuda de custo de transferência','Valor pago ao trabalhador em parcela única, em razão de transferência de seu local trabalho (art. 470 CLT).',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1603','Diárias de viagem - acima de 50% do salário','Valor pago ao empregado a título de diária de viagem, superior a 50% do salário-base desse, desde que não exigida a prestação de contas.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1604','Diárias de viagem – até 50% do salário','Valor pago ao empregado a título de diária de viagem, desde que não exceda a 50% do seu salário-base mensal.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1605','Ressarcimento de despesas pelo uso de veículo do empregado','Indenização de despesas ao trabalhador, pela utilização de veículo de sua propriedade.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1606','Outras indenizações e ressarcimentos','Valor pago ao trabalhador relativo a outras indenizações e ressarcimentos não previstos nos itens anteriores.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1801','Alimentação / cesta básica – inscrita no PAT','Fornecimento de alimentação "in natura" ou cesta básica, ao trabalhador, quando a empresa é inscrita no PAT - Programa de Alimentação de Trabalhador.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1802','Alimentação / cesta básica – não inscrita no PAT','Fornecimento de alimentação "in natura" ou cesta básica, ao trabalhador, quando a empresa não é inscrita no PAT - Programa de Alimentação de Trabalhador.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1803','Vale-transporte (lei nº 7.418/85)','Fornecimento de vale-transporte observado o disposto na lei nº 7.418/85. Devem ser classificados nesse código.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('1804','Etapas (marítimos)','Valor pago ao trabalhador marítimo, a título de alimentação.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('3501','Direitos autorais','Valor pago em decorrência da cessão de direitos autorais.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('3503','Prestação de serviços – Transportador Autônomo','Valor pago a contribuintes individuais em trabalhos de natureza eventual e sem vínculo trabalhista, na prestação de serviços de fretes e carretos.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('3504','Prestação de serviços, exceto transportador autônomo','Valores pagos a contribuintes individuais em trabalhos de natureza eventual e sem vínculo trabalhista, na prestação de serviços, exceto fretes e carretos.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('3505','Retiradas (pró-labore) de diretores empregados','Pró-labore ou retirada (remuneração) paga a diretores empregados (CLT).',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('3506','Retiradas (pró-labore) de diretores não empregados','Pró-labore ou retirada (remuneração) paga a diretores não empregados.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('3508','Retiradas (pró-labore) de proprietários ou sócios','Pró-labore ou retirada (remuneração) paga a proprietários ou sócios da empresa.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('3509','Vestuário e equipamentos','Valor correspondente a vestuários, equipamentos e outros acessórios fornecidos ao empregado e utilizados no local de trabalho para prestação dos respectivos serviços.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('3510','Prêmios','Prêmios diversos pagos ao trabalhador.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('3511','Pagamentos a não residentes no país','Valor relativo a pagamentos efetuados a pessoas físicas não residentes no país.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('3512','Empréstimos','Valor pago pelo empregador ao trabalhador (provento) a título de empréstimo para posterior desconto.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('3513','Reembolsos diversos','Valor relativo a reembolsos diversos referentes a descontos indevidos efetuados em competências anteriores',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('4001','Auxílio-acidente do trabalho','Adiantamento efetuado pelo empregador ao trabalhador relativo a benefício a ser pago pela previdência social ao trabalhador acidentado.',GETDATE());
INSERT INTO Rubrica(CodigoEsocial,Nome,Descricao,Inclusao)VALUES('4002','Complementação salarial de auxílio-doença','Valor pago pela empresa relativo a complementação salarial de auxílio-doença, extensiva à totalidade dos empregados.',GETDATE());
